import React, {useState, useEffect} from 'react';
import img from '../images/police.jpeg';
import { Container, Form, Row, Col, Image, Button, InputGroup} from 'react-bootstrap';

const axios = require('axios');

export default function EvidenceLog () {
    const [caseID, setCaseID] = useState([{}]);

    useEffect(() => {
        axios.get('http://localhost:3005/caseID')
        .then((res) => {
            if (res) {
                setCaseID(res.data);
            }
    });
 }, []); 
 const [ET, setET] = useState([{}]);
 const getET = () => {
     axios.get('http://localhost:3005/evidenceLog/ET/')
     .then((res) => {
         if (res) {
             setET(res.data);
         }
     });       
 }
    useEffect(() => {
    axios.get('http://localhost:3005/evidenceLog/ET')
    .then((res) => {
        if (res) {
            setET(res.data);
        }
});
}, []); 

    function onChangeText (event){
        return(event.target.value);
    }
    //viewing= get
    //update= put
    //adding new things = post

    function submit(onChangeText)
    {
        axios.get('')
    }
    function onChangeET(onChangeET)
    {
        axios.get('http://localhost:3005/evidenceLog/ET/')
        .then((res) => {
            if (res) {
                setET(res.data);
            }
        })
    }

    useEffect(() => {
        getET();
    }, []);

    return (
        <Container fluid>
            <Row>
                <Col md={6}>
                    <h1>Evidence Log</h1>
                </Col>
            </Row>
            <Row>
                <Col md={3}>
                    <h5>Insert Case ID</h5>
                    <Button type="submit" class="btn btn-primary" onClick={submit}>
                        Enter
				    </Button>
                </Col>
		        <Col md={3}>
                <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>Enter Case ID</Form.Label>
                <Form.Control type="text" placeholder="case ID" onChange={onChangeText}/>
                </Form.Group>
                <Col md={1}>
                </Col>
                <Form>
                <Form.Label>Select evidence type</Form.Label>
                        <Form.Select as="select">
                            <option>Select...</option>
                            {ET.length && ET.map((item, index)=> (
                                <option value={index}>{item.ET}</option>
                            ))}
                        </Form.Select>
                    </Form>
                    <Button type="submit" class="btn btn-primary" onClick={onChangeET}>
                        Enter
				    </Button>
                </Col>
                <Col md={6}>
                   <Image src={img}/> 
                </Col>
            </Row>
        </Container>
    )
}
